import React from "react";
export default class Slogan extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      image: "/static/images/splash-1.jpg"
    };
  }
  render() {
    return (
      <section className="slogan">
        <p>
          فروش پایان یک معامله نیست , <strong>آغاز یک تعهد</strong> است .
        </p>
      </section>
    );
  }
}
